import { createRoot } from 'react-dom';
import Extraer from "./componentes/extraer";
import GiphyComponent from "./componentes/gif";

const App = () => {
    return (
        <div>
            <h1>Hola Mundo</h1>
            <Extraer/>
            <GiphyComponent/>
        </div>
        );
};

// Renderizar la aplicación utilizando createRoot
createRoot(document.getElementById('root')).render(<App />);
